"use strict";(self.webpackChunkdocs_fintesk_com=self.webpackChunkdocs_fintesk_com||[]).push([[4859],{53981:e=>{e.exports=JSON.parse('{"tag":{"label":"Getting started","permalink":"/es/tags/getting-started","allTagsPath":"/es/tags","count":27,"items":[{"id":"kb/pipelines/how-can-i-add-a-stage-to-my-pipeline","title":"\xbfC\xf3mo puedo agregar una etapa a mi embudo?","description":"Para agregar una nueva etapa a su embudo, haga clic en el icono l\xe1piz junto al nombre de su embudo o pasee su cursor sobre un embudo despu\xe9s de abrir el men\xfa desplegable.","permalink":"/es/kb/pipelines/how-can-i-add-a-stage-to-my-pipeline"},{"id":"kb/getting-started/how-can-i-delete-items-in-fintesk","title":"\xbfC\xf3mo puedo eliminar los elementos en Fintesk?","description":"Dependiendo de la situaci\xf3n, es posible que deba eliminar elementos en Fintesk de muchas maneras diferentes. Hemos construido varios formas diferentes para eliminar elementos en Fintesk y ayudar a abordar cualquier situaci\xf3n.","permalink":"/es/kb/getting-started/how-can-i-delete-items-in-fintesk"},{"id":"kb/pipeline-view/how-can-i-delete-a-deal-in-the-pipeline-view","title":"\xbfC\xf3mo puedo eliminar un negocio en la vista de embudos?","description":"Para eliminar un negocio en la vista de embudo, haga clic y mantenga presionado el negocio que desea eliminar y arrastre al bot\xf3n \\"Eliminar\\" en la parte inferior de la pantalla.","permalink":"/es/kb/pipeline-view/how-can-i-delete-a-deal-in-the-pipeline-view"},{"id":"kb/importing-data/how-can-i-format-dates-to-import-into-fintesk","title":"\xbfC\xf3mo puedo formatear las fechas para importar a Fintesk?","description":"Fintesk admite m\xfaltiples formatos y configuraciones de fecha.Al importar sus propias fechas en cualquier campo del tipo Fecha, hay algunas cosas a tener en cuenta:","permalink":"/es/kb/importing-data/how-can-i-format-dates-to-import-into-fintesk"},{"id":"kb/pipelines/how-can-i-customize-my-pipeline-stages","title":"\xbfC\xf3mo puedo personalizar mis etapas de embudos?","description":"Fintesk viene con un embudo de ventas b\xe1sico que describe un flujo de ventas directo. A medida que los negocios se mueven a trav\xe9s de estas etapas, se le da una visi\xf3n general visual de d\xf3nde est\xe1n sus productos o servicios en el proceso de ventas.","permalink":"/es/kb/pipelines/how-can-i-customize-my-pipeline-stages"},{"id":"kb/pipelines/how-can-i-have-multiple-pipelines","title":"\xbfC\xf3mo puedo tener m\xfaltiples embudos?","description":"Para muchas compa\xf1\xedas, hay m\xfaltiples procesos utilizados para en la finalizaci\xf3n de una venta, por lo que puede crear m\xfaltiples embudos para sus negocios.","permalink":"/es/kb/pipelines/how-can-i-have-multiple-pipelines"},{"id":"kb/pipeline-view/how-can-i-see-deals-in-a-different-pipeline","title":"\xbfC\xf3mo puedo ver negocios en un embudo diferente?","description":"Para ver otro embudo en su cuenta de Fintesk, haga clic en el men\xfa desplegable y seleccione el embudo que desea ver.","permalink":"/es/kb/pipeline-view/how-can-i-see-deals-in-a-different-pipeline"},{"id":"kb/getting-started/how-is-fintesk-data-organized","title":"\xbfC\xf3mo se organizan los datos de Fintesk?","description":"Organizar sus negocios, contactar personas, organizaciones, actividades o productos es esencial para su proceso de ventas. Fintesk lo ayuda a organizar todos sus elementos y vincularlos para una mejor visibilidad.","permalink":"/es/"},{"id":"kb/getting-started/what-is-the-difference-between-a-user-and-a-seat","title":"\xbfCu\xe1l es la diferencia entre un usuario y un asiento?","description":"En Fintesk, su suscripci\xf3n se calcula por el n\xfamero de asientos que tiene en su cuenta. Un usuario activo (o invitado) siempre tomar\xe1 un asiento una vez que se hayan agregado a Fintesk, pero es posible tener asientos vac\xedos si los usuarios han sido desactivados o a\xfan no han agregado.","permalink":"/es/kb/getting-started/what-is-the-difference-between-a-user-and-a-seat"},{"id":"kb/importing-data/why-do-my-imported-currency-values-appear-as-0","title":"\xbfPor qu\xe9 mis valores de moneda importados aparecen como \\"0\\"?","description":"Al importar desde hojas de c\xe1lculo, aseg\xfarese de que todos los valores monetarios (para campos predeterminados, como el valor del negocio, y para cualquier campo personalizado donde tenga monedas) est\xe9n formateados como n\xfameros sin s\xedmbolos de moneda (as\xed que 1000000000 en lugar de $ 1000000000).","permalink":"/es/kb/importing-data/why-do-my-imported-currency-values-appear-as-0"},{"id":"kb/importing-data/changing-the-field-type-of-a-custom-field","title":"Cambiar el tipo de campo de un campo personalizado","description":"La mejor manera de cambiar el tipo de un campo personalizado es recrear el campo en el tipo que desea y usar la funci\xf3n Fintesk \\"ID del sistema\\" para transferir los datos existentes al nuevo campo.","permalink":"/es/kb/importing-data/changing-the-field-type-of-a-custom-field"},{"id":"kb/getting-started/search-finding-what-you-need","title":"Encontrando lo que necesitas","description":"La barra de b\xfasqueda en Fintesk le permite encontrar y acceder r\xe1pidamente a cualquier negocio, contactos, actividades y productos en tu cuenta de Fintesk.","permalink":"/es/kb/getting-started/search-finding-what-you-need"},{"id":"developers/overview/getting-started","title":"Getting started","description":"Check out our Changelog for the latest changes regarding our Developer Platform.","permalink":"/es/developers/overview/getting-started"},{"id":"kb/getting-started/fintesk-glossary","title":"Glosario de Fintesk","description":"Al usar Fintesk o navegar por las muchas gu\xedas de ayuda en nuestra base de conocimiento, puede encontrar t\xe9rminos con los que no est\xe1 familiarizado o desea aclarar. En esos casos, \xa1nuestro glosario podr\xeda resultar muy \xfatil!","permalink":"/es/kb/getting-started/fintesk-glossary"},{"id":"kb/importing-data/import-fields","title":"Import fields","description":"Cuando importa hojas de c\xe1lculo en Fintesk, es importante saber en qu\xe9 campos est\xe1n disponibles para que usted mueva los datos de la hoja de c\xe1lculo.","permalink":"/es/kb/importing-data/import-fields"},{"id":"kb/importing-data/importing-mandatory-fields","title":"Importaci\xf3n-> campos obligatorios","description":"Al importar datos a Fintesk desde una hoja de c\xe1lculo, es importante incluir los campos que son obligatorios para que cada elemento se importe con \xe9xito. Este art\xedculo lo lleva a trav\xe9s de los cuales los campos son obligatorios para la importaci\xf3n.","permalink":"/es/kb/importing-data/importing-mandatory-fields"},{"id":"kb/importing-data/importing-advanced-mapping","title":"Importaci\xf3n-> Mapeo avanzado","description":"Al importar en Fintesk, algunos campos pueden ser m\xe1s complicados para mapear su hoja de c\xe1lculo dependiendo de c\xf3mo se configuren los campos. Los campos de m\xfaltiples opciones, direcci\xf3n y tipo de tel\xe9fono requieren un paso adicional para que se asignen correctamente.","permalink":"/es/kb/importing-data/importing-advanced-mapping"},{"id":"kb/importing-data/importing-mapping-your-fields","title":"Importaci\xf3n-> Mapeo de sus campos","description":"Para que usted importe sus datos hacia Fintesk correctamente, deber\xe1 asignar las columnas de su hoja de c\xe1lculo a los campos en Fintesk. De esta manera, puede asegurarse de que sus personas de contacto, organizaciones, negocios, actividades, notas o productos se importen correctamente con sus datos relevantes.","permalink":"/es/kb/importing-data/importing-mapping-your-fields"},{"id":"kb/importing-data/importing-sample-import-spreadsheets","title":"Importaci\xf3n-> Muestra de hojas de c\xe1lculo de importaci\xf3n","description":"Si necesita ayuda con su Importaci\xf3n de datos hacia Fintesk, Es posible que desee comenzar con un documento de plantilla para ver la mejor manera de proceder.","permalink":"/es/kb/importing-data/importing-sample-import-spreadsheets"},{"id":"kb/importing-data/importing-data-into-fintesk-with-spreadsheets","title":"Importar datos a Fintesk con hojas de c\xe1lculo","description":"Puede importar sus datos a Fintesk desde archivos de hoja de c\xe1lculo XLS, XLSX y CSV, lo que le permite agregar negocios, organizaciones, persona, productos, notas and actividades todo al mismo tiempo.","permalink":"/es/kb/importing-data/importing-data-into-fintesk-with-spreadsheets"},{"id":"kb/getting-started/interface-in-fintesk","title":"Interfaz Fintesk","description":"La interfaz es el lugar donde puede interactuar con el software Fintesk y realizar un seguimiento de sus ventas y datos. Como vendedor ocupado, es posible que deba moverse r\xe1pidamente en la aplicaci\xf3n Fintesk para encontrar la informaci\xf3n que sea m\xe1s relevante para usted.","permalink":"/es/kb/getting-started/interface-in-fintesk"},{"id":"kb/pipeline-view/the-rotting-feature","title":"La funci\xf3n de estancamiento","description":"La caracter\xedstica de estancamiento ofrece conciencia de los negocios que han estado inactivos durante demasiado tiempo. Una vez habilitado y configurado, su embudo le notificar\xe1 visualmente cualquier negocio que haya permanecido intacto por m\xe1s tiempo que el per\xedodo de estancamiento definido.","permalink":"/es/kb/pipeline-view/the-rotting-feature"},{"id":"kb/getting-started/organization-vs-company-account","title":"Organizaci\xf3n vs. cuenta de la empresa","description":"Cuando se crea una cuenta de Fintesk, se crean una cuenta de usuario y la propia cuenta de la empresa.","permalink":"/es/kb/getting-started/organization-vs-company-account"},{"id":"kb/importing-data/transferring-data-to-a-different-fintesk-company-account","title":"Transferring data to a different Fintesk company account","description":"Importando y exportando sus datos","permalink":"/es/kb/importing-data/transferring-data-to-a-different-fintesk-company-account"},{"id":"kb/importing-data/updating-fintesk-data-with-a-spreadsheet","title":"Updating Fintesk data with a spreadsheet","description":"Tener una gran base de datos de negocios, personas o cualquier otro elemento puede ser natural al administrar sus ventas. Sin embargo, se puede esperar que alguna informaci\xf3n se vuelva anticuada con el tiempo. Actualizar cada uno de ellos manualmente es factible, pero si hay mucha informaci\xf3n que debe actualizarse, puede requerir un tiempo y un esfuerzo importantes que podr\xeda estar utilizando para concretar las negocios y sus ventas.","permalink":"/es/kb/importing-data/updating-fintesk-data-with-a-spreadsheet"},{"id":"kb/getting-started/fintesk-user-vs-company-account","title":"Usuario de Fintesk vs. Cuenta de la empresa","description":"Cuando se crea una cuenta de Fintesk, se crean una cuenta de usuario y una cuenta de la empresa.","permalink":"/es/kb/getting-started/fintesk-user-vs-company-account"},{"id":"kb/pipeline-view/pipeline-view","title":"Vista de Embudo","description":"Fintesk lo ayuda a realizar un seguimiento del progreso de su negocio al proporcionarle informaci\xf3n sobre sus negocios en funci\xf3n de qu\xe9 etapa de embudo ocupa en su Vista de embudos.","permalink":"/es/kb/pipeline-view/"}],"unlisted":false}}')}}]);